double TDistributionTable::getCriticalValue(double alpha, int df){
    if (df > 150) {
        throw std::invalid_argument("Degrees of freedom must be less than 150");
        return 1;
    }
    if (alpha*100 != std::round(alpha*100)) {
        throw std::invalid_argument("Alpha must be a multiple of 0.01");
        return 1;
    }
    // get critical value from t table
    df += 1;
    std::vector<double> df_row = ttable[df];
    int alpha_index = (int)(alpha * 100) - 1;
    double t_value = df_row[alpha_index];
    return t_value;
}    
